var DigitalFlash=angular.module("DigitalFlash",["ngRoute","ngAnimate","DigitalFlashCtrls","DigitalFlashServices"]),DigitalFlashServices=angular.module("DigitalFlashServices",[]);DigitalFlashServices.factory("displayStacks",function(){return function(){for(var stacks=[],i=0;i<localStorage.length;i++){var stackKey=localStorage.key(i),stack_name=stackKey.replace("db_","").replace(/_/g," "),stack_slug=stackKey.replace("db_","");stack_array={name:stack_name,slug:stack_slug},stacks.push(stack_array)}return stacks}});